import React from 'react';
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route, Navigate, Link } from "react-router-dom";
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Shop from "./pages/Shop";
import About from "./pages/About";
import FAQ from "./pages/FAQ";
import styles from "./index.css"
import PeachSticker from "./pages/images/peachSticker.jpg"

export default function App() {
  return (

    <BrowserRouter className = {styles.navContainer}>
      <Routes className = {styles.menuRoute}>
        <Route className = {styles.menuRoute} path="/" element={<Layout />}>
          <Route index element={<Home />} className = "menuElement" />
          <Route className = {styles.menuElement} path="Shop" element={<Shop />} >
          <Link to="Stickers"><img class = "productPicture" src={require(PeachSticker)}/></Link>
          </Route>
          <Route className = {styles.menuElement} path="About" element={<About />} />
          <Route className = {styles.menuElement} path="FAQ" element={<FAQ/>}  />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
